import React from "react";
import classes from "./UserDetails.module.css";

const UserDetails = props =>{

    return(
        <div className={classes["user-profile-details-div"]}>
            <div>
              <div className={classes["profile-heading"]}>Name:</div>
              <input className={classes["login-input-text"]} type="text" />
            </div>
            <div>
              <div className={classes["profile-heading"]}>Email Address:</div>
              <input className={classes["login-input-text"]} type="text" />
            </div>
            <div>
              <div className={classes["profile-heading"]}>Change Password:</div>
              <input className={classes["login-input-text"]} type="text" placeholder="Enter new password"/>
            </div>
            <div>
              <div className={classes["profile-heading"]}>Re-enter Password:</div>
              <input className={classes["login-input-text"]} type="text" placeholder="Re-enter new password" />
            </div>
          </div>

    );
}

export default UserDetails;
